```part of 'online_onboarding_otp.dart';

import 'package:flutter/material.dart';

class HalamanPagenya extends StatelessWidget {
  const HalamanPagenya({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return BlocProvider<OnlineOnBoardingCubit>(
      create: (context) => OnlineOnBoardingCubit(),
      child: OnlineOnboardingVerifyOtpPage(),
    );
  }
}

class OnlineOnboardingVerifyOtpPage extends StatefulWidget {
  const OnlineOnboardingVerifyOtpPage({
    Key? key,
  }) : super(key: key);

  static const String routes = '/ux_oob_verify_otp_page';

  @override
  _OnlineOnboardingVerifyOtpPageState createState() => _OnlineOnboardingVerifyOtpPageState();
}

class _OnlineOnboardingVerifyOtpPageState extends BaseState<OnlineOnboardingVerifyOtpPage> {
  final _provider = Get.put(OobProvider());

  String userId = '';
  String? actCode = '';
  bool isSuccess = false;
  Timer? _timer;
  static int _duration = 60;
  int _start = _duration;
  String? nameEvent = "";

  void startTimer() {
    const oneSec = const Duration(seconds: 1);
    _timer = new Timer.periodic(
      oneSec,
      (Timer timer) => setState(
        () {
          if (_start < 1) {
            _timer!.cancel();
            _start = _duration;
          } else {
            _start = _start - 1;
          }
        },
      ),
    );
  }

  @override
  void initState() {
    super.initState();
  }

  @override
  void dispose() {
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return bloc();
  }

  @override
  Widget bloc() {
    return BlocConsumer<OnlineOnBoardingCubit, OnlineOnBoardingState>(
      listener: (context, state) {
        print('ini state : $state');
        if (state is OnlineOnBoardingFailed) {
          showAlertMessage(
            context,
            Utility.getKeyTranslator(Strings.alert),
            state.error,
            Utility.getKeyTranslator(Strings.close),
          );
        } else if (state is OnlineOnBoardingVerifyOtpLoaded) {
          var _data = state.response!;

          // globals.mobilePhoneRegis = _requestData.phoneNumber;
          globals.applicationId = _data.data!.aplicationId;
          globals.id = _data.data!.id;
          globals.isFirst = true;
          Prefs.setAppAndId(state.response!);
          Prefs.setRegId(_data.data!.id);
          Prefs.setAppId(_data.data!.aplicationId);
          _provider.setVerifyOtpData(_data);
          _provider.goToPage();
        }
      },
      builder: (context, state) {
        return bodyView();
      },
    );
  }
